export function ListFriend({initialFriends}) {

  const friends = initialFriends;

  return (
    <div className="">
      <ul>
        {friends.map((friend) => (
          <Friends friend={friend} key={friend.id} />
        ))}
      </ul>
    </div>
  );
}


function Friends({friend}){
  return (
    <li>
    <img src={friend.image} alt={friend.name}/>
      <h3>{friend.name}</h3>
      {
        friend. balance < 0 && <p className="red"> You owe Clark $ </p>
      }
      <button>Select</button>
    </li>
  );
}
